import React from "react";
import mascote3 from "../img/macaco-caolho-mascote3.png";

const Header = (props) => {
  return (
    <div>
      <div className="welcome">
        <h1 style={{ fontFamily: "Press Start 2P" }}>Macaco Caolho</h1>
        <h1 id="rock">Rock n' Drinks</h1>
      </div>

      <div class="container-sm" id="imgMacaco">
        <img src={mascote3} />
      </div>
    </div>
  );
};

export default Header;
